  \"2016-02-27T17:19:04.654370\",\n\t\"name\": \"gunschip-gunpuc03\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"GUNSCHIP and GUNPUC03 are general utility
  programs that read and retrieve NUMIDENT data. Many Social Security Administration
  on-line applications use these utilities to obtain number holder information from
  the NUMIDENT. The on-line applications pass a Social Security Number (SSN) to the
  GUNSCHIP or GUNPUC03 utility that reads the NUMIDENT and if the SSN IS found, returns
  selected data elements to the on-line application. The returned data includes Number
  Holder Name, Other Name, Date of Birth, Birth City, Birth State, Birth Country,
  Mother's Name, and Father's Name. The GUNSCHIP utility additionally provides the
  Citizenship Code, Form Code, Interview Code, Foreign Birth Indicator and Special
  Indicators (SPINs). Some of the applications that use the utilities are Customer
  Help and Information Program (CHIP), Customer Service Record Query (CSRQ), Disability
  Insurance Benefit (DIB), Division of Client Services Application Development (DCSDAD),
  Division of Electronic Processing Support (DEPS) and Personal Earnings Benefits
  Estimate Statements (PEBES).\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
